package Entity;

public class Hair_LengthEntity {
	private String hl_code;
	private String hl_name;
	public Hair_LengthEntity() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Hair_LengthEntity(String hl_code, String hl_name) {
		super();
		this.hl_code = hl_code;
		this.hl_name = hl_name;
	}
	public String getHl_code() {
		return hl_code;
	}
	public void setHl_code(String hl_code) {
		this.hl_code = hl_code;
	}
	public String getHl_name() {
		return hl_name;
	}
	public void setHl_name(String hl_name) {
		this.hl_name = hl_name;
	}
	
	
}
